import React, { Component } from "react";
import { connect } from "react-redux";
import LinkButton from "../../actions/authActions";


class MyFiles extends Component {



    render() {
      const { user } = this.props.auth;

      return (
        <div style={{ height: "75vh" }} className="container valign-wrapper">
          <div className="row">
            <div className="landing-copy col s12 center-align">

            <h4>Files you've uploaded</h4>

            <LinkButton
            style={{
                width: "150px",
                borderRadius: "3px",
                letterSpacing: "1.5px",
                marginTop: "5rem"
              }}
            to='/squid'
            onClick={(event) => {
                console.log(event)
              }}
              className="btn btn-small waves-effect waves-light hoverable blue accent-3"
          >SQUID</LinkButton>



            <LinkButton
            style={{
                width: "150px",
                borderRadius: "3px",
                letterSpacing: "1.5px",
                marginTop: "5rem"
              }}
            to='/myfiles'
            onClick={(event) => {
                console.log('custom event here!', event)
              }}
              className="btn btn-small waves-effect waves-light hoverable blue accent-3"
          >See my files</LinkButton>



            <LinkButton
            style={{
                width: "150px",
                borderRadius: "3px",
                letterSpacing: "1.5px",
                marginTop: "5rem"
              }}
            to='/dashboard'
            onClick={(event) => {
                console.log('custom event here!', event)
              }}
              className="btn btn-small waves-effect waves-light hoverable blue accent-3"
          >Home</LinkButton>



          <button
              style={{
                width: "150px",
                borderRadius: "3px",
                letterSpacing: "1.5px",
                marginTop: "5rem"
              }}
              onClick={this.onLogoutClick}
              className="btn btn-small waves-effect waves-light hoverable blue accent-3"
            >
              Logout
            </button>




            </div>
          </div>
        </div>
      );
    }
  }



  const mapStateToProps = state => ({
    auth: state.auth
  });

  export default connect(
    mapStateToProps,
    {}
  )(MyFiles);
